import { SET_ALERT, REMOVE_ALERT } from "../actions/types2";

const initialState = [];

const Alert_Err2= (state = initialState, action)=> {
	const { type, payload } = action;

	switch (type) {
		case SET_ALERT:
			return [...state, payload];
		case REMOVE_ALERT:
			return state.filter((alert) => alert.id !== payload);
		default:
			return state;
	}
}

export default Alert_Err2;
